import React from 'react';
import logo from './logo.svg';
import './App.css';
import Favicon from './Favicon';
import Plant from './Plant';

function App() {
  return (

      <div className="App">
        <head>
          <Favicon />
        </head>
        <body>
        <image src="./images.pexels.com/photos/20787/pexels-photo.jpg?auto=compress&cs=tinysrgb&h=350" alt="Avatar" style={imageStyle}>Imagen</image>
         <div class="row">
            <div class="column">
              <Plant />
              <Plant />
              <Plant />
            </div>
          </div>
        </body>  
    </div>
  );
}

export default App;
